-- ----------------------------
-- Function structure for getMenus
-- ----------------------------
DROP FUNCTION IF EXISTS `getMenus`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getMenus`(orgid INT) RETURNS varchar(4000) CHARSET utf8mb4
BEGIN
DECLARE oTemp VARCHAR(4000);
DECLARE oTempChild VARCHAR(4000);

SET oTemp = '';
SET oTempChild = CAST(orgid AS CHAR);

WHILE oTempChild IS NOT NULL
DO
SET oTemp = CONCAT(oTemp,',',oTempChild);
SELECT GROUP_CONCAT(menu_id) INTO oTempChild FROM menu WHERE FIND_IN_SET(parent_menu_id,oTempChild) > 0;
END WHILE;
RETURN oTemp;
END
;;
DELIMITER ;
